issue.body:
Hello,
I'm trying to use keyspace notification along with ReJSON module. I cannot find any information about how to enable this feature. I'm using redigo project (GO language) for accesing Redis database. Enabling keyspace notification for "raw" Redis command is quite simple:

```
// subscribe keyspace notification
if _, err := conn.Do("CONFIG", "SET", "notify-keyspace-events", "KEA"); err != nil {
  return err
}
psc := redis.PubSubConn{Conn: conn}
if err := psc.PSubscribe("__key*__:*"); err != nil {
  return err
}

// and receive notifications
for {
  switch msg := psc.Receive().(type) {
  case redis.Message:
    log.Warnf("pattern: %s, channel: %s, data: %s, ", msg.Pattern, msg.Channel, msg.Data)
  case redis.Subscription:
    log.Warnf("Subscription: %s %s %d", msg.Kind, msg.Channel, msg.Count)
  case error:
    log.Errorf("error: %v\n", msg)
    return
  }
}
```

Code above works fine for "original" Redis commands like "SET", "EXPIRE" etc., but doesn't work for ReJSON commands. E.g. "JSON.SET" command doesn't trigger any key event or notification. Could you provide some hints, how to enable this feature? Or there is no support for notifications in the ReJSON?

Thank you.

